@stevemessick My personal suggestion is adding platform check to the plugin's post start activity:
```java
      if(! (PlatformUtils.isIntelliJ() || isAndroidStudio()) ) {
         // post a notification msg that not supported so far and throw an error.
      }

  public static boolean isAndroidStudio() {
    return "AndroidStudio".equalsIgnoreCase(PlatformUtils.getPlatformPrefix());
  }
```
This could reduce some effort on explain that.

> Thanks for the report @bigidea-kz. Unfortunately, we do not currently support WebStorm. How did you install the plugin?
